import re
import json

import execjs
import requests

def get_page_sum(page):
    def mk_url_headers():
        url = 'http://match.yuanrenxue.com/api/match/14/m'
        headers = {
            'Host'            : 'match.yuanrenxue.com',
            'Referer'         : 'http://match.yuanrenxue.com/match/14',
            'User-Agent'      : 'yuanrenxue.project',
            'X-Requested-With': 'XMLHttpRequest',
        }
        return url,headers

    url,headers = mk_url_headers()
    s = requests.get(url, headers=headers)
    retheaders = s.headers

    sessionid = re.findall('sessionid=[^;]+; ', retheaders['Set-Cookie'])[0]
    fingerprint = "; "
    jscode = 'var window = global;' + s.text + ';' + mjs
    m = execjs.compile(jscode).call('get_cookie', 3).replace(';path=/', '')
    newcookie = (fingerprint + sessionid + m).strip(' ;')
    # print('newcookie', newcookie)

    def mk_url_headers(page):
        url = 'http://match.yuanrenxue.com/api/match/14?page={}'.format(page)
        headers = {
            'Accept'          : 'application/json, text/javascript, */*; q=0.01',
            'Cookie'          : newcookie,
            'Host'            : 'match.yuanrenxue.com',
            'Referer'         : 'http://match.yuanrenxue.com/match/14',
            'User-Agent'      : 'yuanrenxue.project',
            'X-Requested-With': 'XMLHttpRequest',
        }
        return url,headers

    url,headers = mk_url_headers(page)
    s = requests.get(url, headers=headers)

    content = s.text
    jsondata = json.loads(content[content.find('{'):content.rfind('}')+1])
    return [i["value"] for i in jsondata['data']]

allvalues = []
for page in range(1, 6):
    values = get_page_sum(page)
    print('page:{} --> values:{}'.format(page, values))
    allvalues.extend(values)
print('sum:{}'.format(sum(allvalues)))

